import { useContext } from 'react';
import { TooltipContext } from './tooltipContext';

const Tooltip = ({ children, text }) => {
  const { tooltip, closeTooltip } = useContext(TooltipContext);

  if (tooltip && tooltip.id === text) {
    return (
      <div className="tooltip" style={{ top: tooltip.top, left: tooltip.left }}>
        {tooltip.text}
      </div>
    );
  }

  return (
    <div
      onMouseEnter={() => {
        closeTooltip();
        setTooltip({ id: text, text, top: event.clientY, left: event.clientX });
